function Rating(props) {
  const { rating, numRatings } = props;
  return (
    <div className="one-line-parent">
      <div className="rating">
        <div className="one-line-child"></div>

        <span>
          <p>&nbsp;{numRatings}</p>
        </span>
      </div>
    </div>
  );
}
export default Rating;
